    // this.setState({ width: window.innerWidth, height: window.innerHeight });
  }

  render() {
    return (
      <div className="weddell">
        <ProjectHeader />
        <div className="iframe-container">
          <iframe
            src="https://noahsjung.com/works/weddell"
            title="weddell"
            frameBorder="0"
            width={this.state.width}
            height={this.state.height}
          ></iframe>
        </div>
      </div>
    );
  }
}

